import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import { makeStyles } from '@mui/styles'
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';
import React,{useState, useEffect,useCallback} from 'react'
import {useNavigate} from "react-router-dom"

const useStyles = makeStyles((theme) => ({
  navbar:{
    backgroundColor:"#000",
    alignItems:"center",
    height:"80px",
    justifyContent:"flex-end"
  },
  input:{
    backgroundColor:'#FFF',
    width:"200px",
    // height:"20px",
    borderRadius:"10px",
  }
}))



export default function Navbar() {
  const [searchData, setSearchData] = useState([])
  const classes = useStyles()

  useEffect(()=>{
      getMovies()
      getPeople()
      getPlanets()

  },[])

  async function getMovies(){
    setSearchData([])
    await fetch(`https://swapi.dev/api/films`)
          .then(response => response.json())
          .then(res => {
            console.log("movies in navbar", res)
            if(res.results != undefined){
              res.results.map((movie)=>{
                setSearchData((prevState) =>[...prevState, movie.title])  
              })
            }
            console.log("calling")

          })
          .catch((error) => console.log(error));
  }

  async function getPeople(){
    await fetch(`https://swapi.dev/api/people`)
          .then(response => response.json())
          .then(res => {
            console.log("people in navbar", res)
            if(res.results != undefined){
              res.results.map((people)=>{
                setSearchData((prevState) =>[...prevState, people.name])  
              })
            }
          })
          .catch((error) => console.log(error));
  }


  async function getPlanets(){
    await fetch(`https://swapi.dev/api/planets`)
          .then(response => response.json())
          .then(res => {
            console.log("planets in navbar", res)
            if(res.results != undefined){
              res.results.map((movie)=>{
                setSearchData((prevState) =>[...prevState, movie.title])  
              })
            }
            getStarships()
          })
          .catch((error) => console.log(error));
  }

  async function getStarships(){
    await fetch(`https://swapi.dev/api/starships`)
          .then(response => response.json())
          .then(res => {
            console.log("starships in navbar", res)
            if(res.results != undefined){
              res.results.map((movie)=>{
                setSearchData((prevState) =>[...prevState, movie.title])  
              })
            }
          })
          getStarships()
          .catch((error) => console.log(error));
  }
  useEffect(()=>{
    console.log("searchData", searchData)
  },[searchData])

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar className={classes.navbar}>
            <Autocomplete
            id="free-solo-demo"
            freeSolo
            className={classes.input}
            options={searchData}
            renderInput={(params) => <TextField {...params} label="search" />}
          />
        </Toolbar>
      </AppBar>
    </Box>
  );
}
